import React from 'react';
import { Link } from 'react-router-dom';
export default function Home() {
  return (
    <div className="max-w-3xl mx-auto p-6">
      <h1 className="text-3xl font-bold">NGO Connect</h1>
      <p className="mt-4">Find and support verified NGOs near you.</p>
      <div className="mt-6 space-x-4">
        <Link to="/ngos" className="px-4 py-2 bg-blue-600 text-white rounded">Browse NGOs</Link>
        <Link to="/login" className="px-4 py-2 bg-gray-200 rounded">Login</Link>
      </div>
    </div>
  );
}
